import './Share.css'
const Share = () => {
    return (
        <div className='share'>
          <div className="shareWrapper">
            <div className="shareTop">
              <img src="assets/person/person1.png" alt="Profile Image" className="shareProfileImg" />
              <input placeholder="What's in your mind Mrami?" className="shareInput" /> 
            </div>
            <hr className='shareHr'/>
            <div className="sharebuttom"></div>
          </div>
        </div>
    );
}

export default Share;
